import SideMenu from 'react-native-side-menu'
import React from 'react';
import { Text } from 'react-native';
function render() {
      const menu = <Menu navigator={navigator}/>;

      return (
        <SideMenu menu={menu}>
          <Text>Hello</Text>
        </SideMenu>
      );
    }
